import React, {useState} from "react"
import { useHistory } from "react-router-dom"
import '../css/main.css';

const Main = (props) =>{
    const history = useHistory();

    if(props.accountInfo === true)
        history.push("/home")
    
    if(typeof props.accountInfo === 'object' && props.accountInfo !== null)
        return(
            <div>this is Home</div>
        )

    if(props.accountInfo === false)
        return(<div></div>);
}

export default Main;
